// import { useState} from 'react';
import Button from '@material-ui/core/Button';
import Grid from '@mui/material/Grid';
import Box from '@material-ui/core/Box';
import Input from '@mui/material/Input';
import 'react-toastify/dist/ReactToastify.css';

const ariaLabel = { 'aria-label': 'description' };

const AddData = (props) => {

  return (
    <section>

      <Grid container spacing={0} direction="column" alignItems="center" justifyContent="center">

          <form alignItems="center" >
            <div >
              <Input placeholder="Name" inputProps={ariaLabel} required style={{width:"500px"}}  />
            </div>
            <div >
              <Input placeholder="Url" inputProps={ariaLabel} required   style={{width:"500px", marginTop:"10px"}}  />
            </div>
            <div >
              <Input placeholder="Type" inputProps={ariaLabel} required   style={{width:"500px", marginTop:"10px"}}  />
            </div>
            <div >
              <Input placeholder="Foundation Year" inputProps={ariaLabel}  style={{width:"500px", marginTop:"10px"}}  />
            </div>

            <Grid container spacing={2}>
              <Grid item>
                <Box pt={2}>
                  <Button variant='outlined'
                      type='submit' sx = {{mt:20}}
                      name="Fetch"
                    >
                      {/* {showDetails ? 'Hide Details' : 'Fetch Detais'} */}
                      Add
                    </Button>
                </Box>
              </Grid>

            </Grid>
          </form>
        </Grid>
      </section>
  )
}

export default AddData;
